import React from 'react';
import styled from 'styled-components';

const Hamburger = () => {
  const Burger = styled.div`
    position: absolute;
    top: 10px;
    right: 10px;
    width: 40px;
    height: 40px;

    .hambuger_container {
      display: flex;
      flex-direction: column;
    }

    .hambuger_layer {
      width: 100%;
      height: 5px;
      background-color: black;
      margin: 3px 0;
    }
  `;

  return (
    <Burger>
      <div className='hambuger_container'>
        <div className='hambuger_layer'></div>
        <div className='hambuger_layer'></div>
        <div className='hambuger_layer'></div>
      </div>
    </Burger>
  );
};

export default Hamburger;
